import React from "react";
import Header from "./Header";
import Content from "./Content";
import Footer from "./Footer"

const Contain = () => {
    return (
        <div>
            <Header />
            <hr />
            <Content />
            <hr />
            <Footer />
        </div>
    );
};

export default Contain;
